import React from 'react'

export default function Movie(props) {

    return (
        <div>
                           <div className='movie-container'>
                                     <div className='movie-image'></div>
                                       <p className='movie-title'>{props.title}</p>
                                        <p className='movie-year'>{props.year}</p>
                            </div>


                           
        </div>
    )
}
